import React from 'react';
import styles from './styles.module.scss';
import Button from '../../components/Button';

const buttons = [
  {
    name: 'Pay with Estar',
    icon: '...'
  },
  {
    name: 'Pay with Estar',
    icon: '...'
  }
];

const Race = () => {
  return buttons.map((button) => (
    <p key={button.name}>
      <Button name={button.name} />
    </p>
  ));
};

export default Race;
